import React, { Component } from "react";
import { Form,Input } from "react-bootstrap";
class homeComponent extends Component {

    render() {

        return (

            <div>
                <Form>
                    <Input type="text" placeholder="Enter name" />
                    <Input type="submit" value="ADD" />
                </Form>

            </div>

        );


    }



}
